import './App.css';
import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


function Square(props){
  return(
    <button className="square">
      {props.value}
    </button>
  );
}

class Board extends React.Component{
  generateSquare(value){
    return (<Square
      value = {1}
    />);
  }

}

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
    </div>
  );
}

export default App;
